import React from "react";
import styles from "../assets/css/home.module.css";

const Homecart = () => {
  const { hcart } = styles;

  return (
    <div className={hcart}>
      <div className="container">
        <div className="row">
          <div className=""></div>
        </div>
      </div>
    </div>
  );
};

export default Homecart;
